/* WHOLE TABLE*/
select * FROM table_name;

/* Max deaths in desceding order*/
select StateUnionTerritory, max(Deaths) as Total_Deaths
from table_name
group by StateUnionTerritory
order by Total_Deaths desc;

/* Statewise Total active cases in desceding order*/
select StateUnionTerritory, max(Deaths) as Total_Deaths, max(Cured) as Total_Recovered, max(Confirmed) as Total_Cases, max(Confirmed) - (max(Cured) + max(Deaths)) as Total_Active
from table_name
group by StateUnionTerritory
order by Total_Active desc;

/*Statewise Recovery rate*/
Select StateUnionTerritory , (max(Cured)/max(confirmed)*100) as Recovery_rate
from table_name
group by StateUnionTerritory
order by Recovery_rate desc;

/*National Recovery rate*/
select avg(Recovery_rate) as National_Recovery_rate
from (
Select (max(Cured)/max(confirmed)*100) as Recovery_rate
from table_name)as inner_query ;

/*Datewise positive cases*/
Select sum(confirmed) as postive_cases, date
from table_name
group by date;

/*Datewise active cases*/
select date, sum(Confirmed) - (sum(Cured) + sum(Deaths)) as Total_Active
from table_name
group by date;

 /*Datewise deaths*/
select date, sum(Deaths) as Total_Deaths
from table_name
group by date;

/*datewise Recovery*/
Select date , sum(Cured) as Recovery
from table_name
group by date;

/*Datewise Recovery rate*/
Select date , (sum(Cured)/sum(confirmed)*100) as Recovery_rate
from table_name
group by date;



